import './ImageCollage.css';

import guitars from "../../assets/CollagePhotos/gutars.jpg"; 
import kcphotos from "../../assets/CollagePhotos/kcphoto.jpg"; 
const ImageCollage = () => {
  return (
    <section class='ImageCollage'>

      <div class="Collage_Container">
        <img class="imageFormat" src="" alt=""></img>
        <img class="imageFormat" src="" alt=""></img>
        <img class="imageFormat" src="" alt=""></img>
        <img class="imageFormat" src="" alt=""></img>
        <img class="imageFormat" src="" alt=""></img>
      </div>


    </section>
  )
}

export default ImageCollage;
